import React from 'react';
import './css/Projects.css'; // Import CSS file

const CodingWork = () => {
  return (
    <section className="section coding-work" onClick={() => window.location.href='/coding-work'}>
      <div className="content">
        <div className="coding-work-container">
          <div className="coding-work-tile">
            <h2>Title 1</h2>
            <p>Description about Project 1 goes here...</p>
          </div>
          <div className="coding-work-tile">
            <h2>Title 2</h2>
            <p>Description about Project 2 goes here...</p>
          </div>
          <div className="coding-work-tile">
            <h2>Title 3</h2>
            <p>Description about Project 3 goes here...</p>
          </div>
        </div>
      </div>
    </section>
  );
};

export default CodingWork;
